import React from 'react';

import sImgG from '../images/icons8-google-plus-50.png';
import sImgL from '../images/icons8-linkedin-50.png'
import sImgT from '../images/icons8-twitter-50.png'
import sImgW from '../images/icons8-whatsapp-50.png'
import icLogo from '../images/favicon.png'





const Footer = () => {
    return (
        <div>
            <div className="socials">
                <img src={sImgG} alt=""/>
                <img src={sImgL} alt=""/>
                <img src={sImgT} alt=""/>
                <img src={sImgW} alt=""/>

            </div>
            <div className="copywright">
                <img src={icLogo} height="20px" width="20px" alt=""/>
                <span>HUCKSAPP</span>
                Copywright &copy; 2019
            </div>
        </div>
    );
}

export default Footer;
